import './APIComponent.css';

async function APIComponent ({ responses }) {
    console.log(responses)
    return(responses.map((response) => {
        response.key=response.id;
        return (
            <div key={response.id}>
                <br/>
                <div>
                {response}
                </div>
                <div>
                {response}
                </div>
                <div>
                {response}
                </div>
                <br/>
            </div>
    )}))
}

export default APIComponent;
